import { StrictMode ,Children} from "react";
import { createRoot } from "react-dom/client";
import "./styles.css";

function App() {
  return (
    <div className="container">
     <TipCalculator/>

    </div>
  );
}

function TipCalculator(){
  return (
    <div>
       <BillInput/>
     <SelectPercentage>How did you like the services ?</SelectPercentage>
     <SelectPercentage>How did your Friends like the services ?</SelectPercentage>
     <Output/>
     <Reset/>
    </div>
  )
}


function BillInput(){
  return (
    <div>
      <label>How much was the Bill</label>
      <input type="text" placeholder="Bill value"/>
    </div>
  )

}
function SelectPercentage(){
  return (
    <div>
      <label>{Children}</label>
      <select>
        <option>Dissatisfied (0%)</option>
        <option>It was ok (5%)</option>
        <option>It was good (10%)</option>
        <option>absolutely amazing (20%)</option>

      </select>
    </div>
  )

}
function Output(){}
function Reset(){}

const rootElement = document.getElementById("root");
const root = createRoot(rootElement);

root.render(
  <StrictMode>
    <App />
  </StrictMode>
);
